import fetch from 'isomorphic-fetch';
const apiDomain = "https://api-bedrijfswebsite.mediaverse-dev.nl";
export function postContact(body) {
  return fetch(`${apiDomain}/test/api/auth/contact`, {
    method: 'POST',
    headers: {
      'Accept': 'application/json',
      "Content-Type": "application/json"
    },
    cache: 'default',
    mode: 'cors',
    body: JSON.stringify(body)
  }).then(resp => {
    return resp.json();
  });
}
